const User = () => {
    return <div>
        <h1>User Information</h1>
        <div className="userInfoContainer">
            <label>Name:</label>
            <input type="text"></input>
            <label>Phone num:</label>
            <input type="text"></input>
            <label>City:</label>
            <input type="text"></input>
            <label>Address:</label>
            <input type="text"></input>
        </div>
    </div>;
};

export default User;
